import {
   Alignment,
   Button,
   Classes,
   H5,
   Navbar,
   NavbarDivider,
   NavbarGroup,
   NavbarHeading,
   Switch
} from '@blueprintjs/core';

export default class BluePrintView extends Component {
   render() {
      return <div></div>;
   }
}
